import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";

function Card(props) {
  return (
    <>
      <header>
        <div className="header">
          <p> top amazon series</p>
        </div>
      </header>
      <section>
        <div className="cards">
          <div className="card">
            <img src={props.imgsrc}
              alt="Mirjapur"
              className="img" />
            <p>amazon original series</p>
            <h2>{props.sname}</h2>
            <button><a href={props.slink} target="_blank">Watch now</a></button>
          </div>
        </div>

      </section>

    </>

  );
}

ReactDOM.render(
  <>
    <Card imgsrc="https://wallpapercave.com/wp/wp7787787.jpg"
          sname="MIRZAPUR"
          slink ="https://www.netflix.com/in/title/80100172"
    />
  </>
  , document.getElementById('root')
);
